import PropTypes from 'prop-types'
import Button from './Button'
import Tasks from './Tasks'

const Header = ({title}) => {
    const onClick = (e) => {
        console.log('click')
    }

    return (
        <header className='header'>
            <h1>{title}</h1>
            <Button color='green' text='hello' onClick={onClick}/>
            <Tasks/>
        </header>
    )
}

Header.defaultProps = {
    title: 'Task Tracker'
}

Header.propTypes = {
    title: PropTypes.string.isRequired
}

//CSS in JS
